}

@media (hover: none) {
  .yt-spec-button-shape-next--gen-ai-gradient.yt-spec-button-shape-next--filled:hover { background: linear-gradient(90deg, rgb(127, 14, 127) 0px, rgb(170, 9, 170) 20%, rgb(255, 78, 69) 100%); }
}

@media (hover: none) {
  .yt-spec-button-shape-next--gen-ai-gradient.yt-spec-button-shape-next--filled:active { background: linear-gradient(90deg, rgb(0, 122, 101) 0px, rgb(127, 14, 127) 100%); border-color: transparent; }
}

@media (hover: none) {
  .yt-spec-button-shape-next--gen-ai-gradient.yt-spec-button-shape-next--tonal:hover { background: linear-gradient(90deg, rgba(127, 14, 127, 0.2) 0px, rgba(170, 9, 170, 0.2) 20%, rgba(255, 78, 69, 0.2) 100%); }
}

@media (hover: none) {
  .yt-spec-button-shape-next--gen-ai-gradient.yt-spec-button-shape-next--tonal:active { background: linear-gradient(90deg, rgba(0, 122, 101, 0.2) 0px, rgba(127, 14, 127, 0.2) 100%); border-color: transparent; }
}

