  50% { background: transparent; width: 50px; height: 50px; left: 0px; top: 0px; }
}

@media only screen and (min-width: 2244px) {
  #grid-container-skeleton .rich-grid-media-skeleton { width: calc(16.6% - 16px); flex-basis: auto; -webkit-box-flex: 0; flex-grow: 0; }
}

@media (max-width: 999px) {
  #watch-page-skeleton { width: 854px; }
  #watch-page-skeleton #container { display: flex; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; }
  #watch-page-skeleton #info-container { -webkit-box-ordinal-group: 2; order: 1; }
  #watch-page-skeleton #grid-container-skeleton { -webkit-box-ordinal-group: 2; order: 1; width: calc(-474px + 100vw); }
  #watch-page-skeleton #related { -webkit-box-ordinal-group: 3; order: 2; width: 100%; max-width: 100%; }
}

@media (min-width: 1000px) {
  #watch-page-skeleton { width: 100%; max-width: 1066px; }
  #watch-page-skeleton #related { margin-top: -360px; padding-left: 24px; }
  #watch-page-skeleton #info-container { width: 640px; }
  #watch-page-skeleton.theater #info-container { width: 100%; padding-right: 426px; }
}
